import React from 'react';
import './navbar.css'; 

const Navbar = () => {
    return (
        <div>
            <div className="gpt3__navbar">
                <div className="gpt3__navbar-links">
                    <div className="gpt3__navbar-links-logo"></div>
                </div>
            </div>
        </div>
    )
}

export default Navbar
